class MassiveInputOutputFragment : Fragment() , MassiveInputOutputAdapter.OnClickListener{

    private lateinit var binding: FragmentMassiveInputOutputBinding
    private var mainInterface: MainInterface? = null
    private val massiveInputOutputVM: MassiveInputOutputVM by activityViewModels()
    private var calendar: Calendar = Calendar.getInstance(Locale(LENGUAGEes, COUNTRYES))
    private var listFilter = mutableListOf<MassiveInputOutput>()
    override fun onCreateView(inflater: LayoutInflater, container: ViewGroup?, savedInstanceState: Bundle?): View {
        binding = FragmentMassiveInputOutputBinding.inflate(inflater, container, false)
        return binding.root
    }
    override fun onViewCreated(view: View, savedInstanceState: Bundle?) {
        super.onViewCreated(view, savedInstanceState)
        binding.btnDate.setOnClickListener {
            dataPicker()
        }
        binding.etFilter.doOnTextChanged { text, _, _, _ ->
            if (text.isNullOrEmpty()) {
                binding.rvInputOutput.adapter = MassiveInputOutputAdapter(listFilter, this)
            } else {
                var newListFiletr = mutableSetOf<MassiveInputOutput>()
                newListFiletr.clear()
                newListFiletr = listFilter.filter {
                    it.nombreCompleto.lowercase().contains(text) || it.numEmple.contains(text)
                }.toMutableSet()
                binding.rvInputOutput.adapter = MassiveInputOutputAdapter(newListFiletr.toList(), this)
            }
        }
        massiveInputOutputVM.dataMassiveFilter.observe(viewLifecycleOwner){filterData->
            if (!filterData.isNullOrEmpty()){
                val newListFiletr = mutableSetOf<MassiveInputOutput>()
                listFilter.forEach {data->
                    if (data.tipoRegistro.any{ filterData.contains(it)} && data.fecha == Utilities.getDateFromMiliseconds(calendar.timeInMillis, "dd/MM/yyyy")){
                        if (!newListFiletr.contains(data)){
                            newListFiletr.add(data)
                        }
                    }
                }
                if (newListFiletr.isNotEmpty()){
                    binding.clData.visibility = View.VISIBLE
                    binding.tvDataEmpty.root.visibility = View.INVISIBLE
                    binding.rvInputOutput.adapter = MassiveInputOutputAdapter(newListFiletr.toList(), this)
                }else{
                    binding.clData.visibility = View.INVISIBLE
                    binding.tvDataEmpty.root.visibility = View.VISIBLE
                }
            }else{
                setDateButton()
            }
        }
        binding.btnBak.setOnClickListener {
            changeDay(false)
        }
        binding.btnNext.setOnClickListener {
            changeDay(true)
        }
        binding.floating.setOnClickListener {
            findNavController().navigate(R.id.to_entradasSalidasMasivasDetalleFragment)
        }

        binding.rvInputOutput.addOnScrollListener(object : RecyclerView.OnScrollListener(){
            override fun onScrolled(recyclerView: RecyclerView, dx: Int, dy: Int) {
                super.onScrolled(recyclerView, dx, dy)
                if (dy > 0){
                    binding.floating.shrink()
                } else {
                    binding.floating.extend()
                }
            }
        })
    }
    private fun changeDay(isNext:Boolean){
        binding.etFilter.setText("")
        massiveInputOutputVM.dataMassiveFilter.value = null
        calendar.set(calendar.get(Calendar.YEAR),calendar.get(Calendar.MONTH),if (isNext) calendar.get(Calendar.DAY_OF_MONTH)+1 else calendar.get(Calendar.DAY_OF_MONTH)-1)
        setDateButton()
    }
    private fun setDateButton(){
        binding.btnDate.text = Utilities.getDateFromMiliseconds(calendar.timeInMillis, "dd / MMMM / yyyy")
        val dataList = DataMassive().getData(calendar.timeInMillis)
        listFilter.addAll(dataList)
        if (dataList.isNotEmpty()){
            binding.clData.visibility = View.VISIBLE
            binding.tvDataEmpty.root.visibility = View.INVISIBLE
            binding.rvInputOutput.adapter = MassiveInputOutputAdapter(dataList, this)
        }else{
            binding.clData.visibility = View.INVISIBLE
            binding.tvDataEmpty.root.visibility = View.VISIBLE
        }
    }
    private fun dataPicker() {
        val datePicker = MaterialDatePicker.Builder
            .datePicker()
            .setTheme(R.style.DialogCalendarRHD)
            .setTitleText(getString(R.string.selecciona_fecha))
            .setSelection(calendar.timeInMillis)
            .build()
        datePicker.show(childFragmentManager, "picker")
        datePicker.addOnPositiveButtonClickListener {
            calendar.timeInMillis = it
            setDateButton()
        }
    }
    override fun onResume() {
        super.onResume()
        mainInterface?.setTextToolbar(getString(R.string.submenu_101))
        mainInterface?.showFilter(true,2)
    }
    override fun onAttach(context: Context) {
        super.onAttach(context)
        if (context is MainInterface) {
            mainInterface = context
        }
    }
    override fun onDetach() {
        super.onDetach()
        mainInterface = null
    }
    override fun onDestroy() {
        massiveInputOutputVM.dataMassiveFilter.value = null
        super.onDestroy()
        mainInterface?.showFilter(false,2)
    }
    override fun onClick(inputOutput: MassiveInputOutput) {
        val bundle = Bundle()
        bundle.putSerializable(Constants.DATA_KEY, inputOutput)
        findNavController().navigate(R.id.to_entradasSalidasMasivasDetalleFragment,bundle)
    }
}
